  [],\n\t\"revision_timestamp\": \"2015-07-08T19:14:59.381976\",\n\t\"name\": \"islscp-ii-hydro1k-elevation-derived-products\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This data set contains coarse scale elevation
  and elevation-based parameters at 1.0 and 0.5-degree spatial resolutions that were
  developed to support a wide variety of global modeling activities through the International
  Satellite Land Surface Climatology Project (ISLSCP) Initiative II data collection.
  These coarse scale data have sufficient statistical information (up to fourth moment)
  to allow a good statistical description of the sub-cell distribution of any particular
  elevation parameter (i.e. elevation, slope and aspect). The database used in the
  development effort was the HYDRO1k product (http://eros.usgs.gov/#/Find_Data/Products_and_Data_Available/HYDRO1K)
  with a native spatial resolution of 1 km, the highest resolution database of global
  coverage of standard elevation-based derivatives (slope, aspect, elevation, compound
  topographic index, etc.). \",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
